import React from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";

const Incidents = ({ incident }) => {
  const incidents = incident.map(inc => (
    <tr key={inc.id}>
      <td>{inc.type}</td>
      <td className='hide-sm'>{inc.scompleteaddress}</td>
      <td>
        <Moment format='YYYY/MM/DD'>{inc.date}</Moment>
      </td>
      <td>
        {inc.user.name} {inc.user.lname}
      </td>
      <td>
        <button
          onClick={() => deleteEducation(inc._id)}
          className='btn btn-danger'
        >
          <i className='fa fa-trash-o' aria-hidden='true'></i>
        </button>
      </td>
    </tr>
  ));
  return (
    <Fragment>
      <h3 className='my-1'> Education Credentials</h3>
      <table className='table'>
        <thead>
          <tr>
            <th>Type</th>
            <th className='hide-sm'>Location</th>
            <th>Volunteer</th>
            <th> Action</th>
          </tr>
        </thead>
        {/* Loop thru the database */}
        <tbody>{educations}</tbody>
      </table>
    </Fragment>
  );
};

Incidents.propTypes = {
  incident: PropTypes.array.isRequired,
};

const mapStateToProps = state => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(Incidents);
